import { useSelector } from "react-redux";
import ReactTable from "react-table";

const TableData = () => {
  const { TableData } = useSelector((state) => state.dashData);
  const columns = [
    {
      Header: "publisherId",
      accessor: "publisherId", // String-based value accessors!
    },
    {
      Header: "impressions_offered",
      accessor: "impressions_offered",
      // Cell: props => <span className='number'>{props.value}</span> // Custom cell components!
    },
  ];
  return (
    <ReactTable
      data={TableData}
      columns={columns}
      //   style={{
      //     height: "400px",
      //     width: "400px",
      //   }}
    />
  );
};
export default TableData;
